import React from 'react';
import './wavy_loader.css';

function Wavy() {
  return (
    <div className="wavy">
      <span style={{ '--i': 0 }}></span>
      <span style={{ '--i': 1 }}></span>
      <span style={{ '--i': 2 }}></span>
      <span style={{ '--i': 3 }}></span>
      <span style={{ '--i': 4 }}></span>
      <span style={{ '--i': 5 }}></span>
    </div>
  );
}

export default Wavy;
